<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1">
    <title>Mikrotik License Generator</title>
    <style>
        @import url('https://fonts.googleapis.com/css2?family=Comfortaa:wght@400&display=swap');

        body {
            font-family: 'Comfortaa', sans-serif;
            background-color: #f3f3f3;
            margin: 0;
            padding: 0;
        }

        .container {
            min-width: 1200px;
            min-height: 700px;
            width: 100%;
            height: 100%;
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: center;
        }

        .con_div {
            display: flex;
            flex-direction: column;
            align-items: center;
            gap: 10px;
        }

        .out_div {
            display: flex;
            flex-direction: column;
            align-items: center;
        }

        h1 {
            margin-bottom: 20px;
            color: #333;
            font-size: 32px;
            font-weight: 500;
        }

        .key_div {
            min-width: 700px;
            max-width: 700px;
            width: 100%;
            height: 250px;
            display: flex;
            flex-direction: column;
            align-items: center;
            gap: 10px;
            background-color: #fff;
            padding: 20px;
            border-radius: 10px;
            box-shadow: 0 2px 6px rgba(0, 0, 0, 0.1);
        }

        .container div input {
            height: 25px;
            width: 235px;
            border-radius: 5px;
            border: 1px solid #ccc;
            outline: none;
            padding: 5px;
            text-align: center;
        }

        p {
            margin-top: 20px;
            font-size: 14px;
            color: #333;
            display: flex;
            flex-direction: column;
            text-align: center;
        }

        code {
            margin: 0;
            padding: 0;
        }

        .dpview {
            display: block;
        }

        .dpnone {
            display: none;
        }

        .button {
            border: 1px solid #ccc;
            border-radius: 12px;
            padding: 10px 16px;
            background: none;
            cursor: pointer;
            display: none;
        }

        .button:hover,
        .button:active {
            background: #ccc;
        }

        #wait {
            display: none;
        }
    </style>
</head>

<body>
    <div class="container">
        <div class="con_div">
            <h1>Mikrotik License Generator</h1>
            <div class="key_div">
                <input spellcheck="false" autocomplete="off" id="uid" name="uid" type="text">
                <button id="keygen" class="button">Generate</button>
                <p class="key_wrapper">KEY: </p>
                <p id="wait">Wait...</p>
                <div class="out_div">
                    <code id="key_l1"></code>
                    <code id="key_l2"></code>
                    <code id="key_l3"></code>
                </div>

                <button id="button" class="button">Copy</button>
            </div>
        </div>
    </div>
</body>
